import './Home.css';
import React from 'react';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';



const Home= () =>  {
  return <>
  <Box>
    <Paper
    sx={{
      position:"relative",
      width:"340px",
      display:"flex",
      justifyContent:"space-between",
      mt:""
    }}
    
    
    
    
    >


    </Paper>
  </Box>
  
  </>
  
}

export default Home;
